import React, { useState, useEffect } from "react";
import {
  LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer
} from "recharts";
import Swal from "sweetalert2";
import "./Electrical.css";
import "bootstrap/dist/css/bootstrap.min.css";

const sections = [
  "TOP_APRON",
  "BOTTOM_APRON",
  "SKF",
  "COMPACT",
  "ELECTRICAL_PANEL",
  "GENERATOR",
  "TRANSFORMER",
];

const Electrical = () => {
  const [selectedDate, setSelectedDate] = useState("");
  const [cumulativeDate, setCumulativeDate] = useState("");
  const [cumulative, setCumulative] = useState([]);
  const [data, setData] = useState({});

  // ✅ Initialize Form Data
  useEffect(() => {
    const initialData = sections.reduce((acc, section) => {
      acc[section] = { type: "", lifeInDays: 0, lifeInMonths: 0, nextSchedule: "" };
      return acc;
    }, {});
    setData(initialData);
  }, []);

  // ✅ Fetch Cumulative Data
  const fetchCumulativeData = async () => {
    if (cumulativeDate) {
      try {
        const res = await fetch(`http://localhost:5000/cumulative/${cumulativeDate}`);
        const data = await res.json();

        const formattedData = sections.map((section) => ({
          section,
          lifeInDays: data[section]?.lifeInDays || 0,
          lifeInMonths: data[section]?.lifeInMonths || 0,
          nextSchedule: data[section]?.nextSchedule || "-",
        }));

        setCumulative(formattedData);
      } catch (err) {
        console.error("Error fetching cumulative data:", err);
      }
    }
  };

  useEffect(() => {
    fetchCumulativeData();
  }, [cumulativeDate]);

  const handleChange = (section, field, value) => {
    setData((prev) => ({
      ...prev,
      [section]: { ...prev[section], [field]: value },
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const newData = { date: selectedDate, ...data };

    try {
      const response = await fetch("http://localhost:5000/add-electrical", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(newData),
      });

      const result = await response.json();

      if (response.ok) {
        Swal.fire("Success!", "Data saved successfully!", "success");
        fetchCumulativeData();
        setSelectedDate("");
      } else {
        throw new Error(result.message);
      }
    } catch (err) {
      Swal.fire("Error!", "Failed to add data.", "error");
      console.error("Error submitting data:", err);
    }
  };

  return (
    <div className="container mt-5">
      <h2 className="mb-4">Cumulative Electrical Data</h2>

      <div className="mb-4">
        <input
          type="date"
          value={cumulativeDate}
          onChange={(e) => setCumulativeDate(e.target.value)}
          className="form-control"
        />
        <button onClick={fetchCumulativeData} className="btn btn-primary mt-2">Fetch Cumulative Data</button>
      </div>

      <table className="table table-bordered">
        <thead>
          <tr>
            <th>Section</th>
            <th>Days</th>
            <th>Months</th>
            <th>Next Schedule</th>
          </tr>
        </thead>
        <tbody>
          {cumulative.map((item, index) => (
            <tr key={index}>
              <td>{item.section}</td>
              <td>{item.lifeInDays}</td>
              <td>{item.lifeInMonths}</td>
              <td>{item.nextSchedule}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Electrical;
